document.write("Name: "+ lastWord + "</br>");
for( var j = 0;j<=lastWord.length - 1; j++)
{
    var word = prompt("Enter single letter of your name in upper case")

    for( var i = 0 ;i < 26 ;i++)
    {
        if(word == arr[i].letter)
        {
            var a = arr[i].shape[1].color[2].legs[2].hands[5].code;
        }
    }
    document.writeln(word + "-" + a+"</br>");
}